INSERT INTO `krns_parm_t` VALUES ('KFS-AR','CustomerAgingReportDetail','CUSTOMER_INVOICE_AGE','KFS1','1','CONFG','120','Determines the last two buckets of the Customer Aging Report. The Customer Aging Report lists the customers which have open invoices for 0-30, 31-60, 61-90, 90-parameter, parameter+ days.','A','KFS'),('KFS-AR','CustomerInvoice','GLPE_RECEIVABLE_OFFSET_GENERATION_METHOD','KFS2','1','CONFG','1','This parameter controls how the entries for the accounts receivable offset are determined. The options include:  \n1: Record the receivable in the same account that receives the income on an invoice and designate a receivable object code by chart.  \n2: Record the receivable in the same account that receives the income on an invoice and designate a receivable object code by subfund group.  \n3: A default accounting key for the receivable is provided by the organization accounting defaults table with the user having the option to edit this on the invoice document. A considerable reconciliation effort may be required if this parameter is changed after the Accounts Receivable module is implemented.','A','KFS'),('KFS-AR','CustomerInvoice','GLPE_RECEIVABLE_OFFSET_OBJECT_CODE_BY_SUB_FUND','KFS3','1','CONFG','GENFND=8110;DFRES=8101;DOFDS=8102','This parameter identifies the sub fund object code to be used on the Customer Invoice receivable transaction when GLPE_RECEIVABLE_OFFSET_GENERATION_METHOD = 2. Option 2 records the receivable in the same account that receives the income with a receivable object code based on the income accounts sub fund group.','A','KFS'),('KFS-AR','CustomerInvoice','MAXIMUM_NUMBER_OF_DAYS_AFTER_CURRENT_DATE_FOR_INVOICE_DUE_DATE','KFS4','1','CONFG','90','This system parameter is used to determine the due date for the Customer Invoice.  It holds the number of days the invoice due date can be from the current date.','A','KFS'),('KFS-AR','CustomerInvoice','OBJECT_CONSOLIDATIONS','KFS5','1','CONFG','CMPN;CPTL;FDBL;SCHL','Object Consolidation(s) restricted from use on a Customer Invoice document.','D','KFS'),('KFS-AR','CustomerInvoice','OBJECT_LEVELS','KFS6','1','CONFG','CASH;CSEQ;PLNT','Object Level(s) restricted from use on a Customer Invoice document.','D','KFS'),('KFS-AR','CustomerInvoiceWriteoff','ALLOW_SALES_TAX_LIABILITY_ADJUSTMENT_IND','KFS7','1','CONFG','Y','Controls the tax entries for accounts receivable write-off. The options include: Y: If your state allows an adjustment to sales tax liability for accounts receivable written off as bad debt, or N: If your state disallows an adjustment to sales tax liability. NOTE: parameter value N must be used with GLPE_WRITEOFF_GENERATION_METHOD=2.','A','KFS'),('KFS-AR','CustomerInvoiceWriteoff','APPROVAL_THRESHOLD','KFS8','1','CONFG','50','Writing off invoices of this value or higher requires Fiscal Officer approval.','A','KFS'),('KFS-AR','CustomerInvoiceWriteoff','GLPE_WRITEOFF_GENERATION_METHOD','KFS9','1','CONFG','1','This parameter controls how the entries for the accounts receivable writeoff are determined. The options include: 1: Record the writeoff in the same account as the income, with the writeoff object code specified on the chart table, or 2: Record the writeoff in the full accounting unit specified on the Organization Accounting Defaults eDoc.','A','KFS'),('KFS-AR','CustomerInvoiceWriteoff','GLPE_WRITEOFF_OBJECT_CODE_BY_CHART','KFS10','1','CONFG','BA=5105;BL=5105;EA=5105;FW=5105;HO=5105;IA=5105;IN=5105;IU=5105;KO=5105;NW=5105;SB=5105;SE=5105;AZ=5105;UA=5105','Identifies the writeoff object code to be used on the invoice writeoff transaction when parameter GLPE_WRITEOFF_GENERATION_METHOD = 1. The writeoff will be recorded in the same account that receives the income and the object code will be based on the income account\'s chart code. If GLPE_WRITEOFF_GENERATION_METHOD equals anything but 1 this parameter will not be used. ','A','KFS'),('KFS-AR','CustomerLoadStep','MAX_NUMBER_OF_RECORDS_PER_DOCUMENT','KFS11','1','CONFG','250','Set a limit on the number of customers that may be uploaded in a single batch.','A','KFS'),('KFS-AR','Document','ENABLE_SALES_TAX_IND','KFS12','1','CONFG','Y','Controls whether sales tax functionality within the AR module is enabled. If enabled indicators and tax calculations will be available on various Accounts Receivable documents. ','A','KFS'),('KFS-AR','InvoiceRecurrence','INVOICE_RECURRENCE_INTERVALS','KFS13','1','CONFG','M=Monthly;Q=Quarterly','These are the valid intervals for invoice recurrence.','A','KFS'),('KFS-AR','InvoiceRecurrence','MAXIMUM_RECURRENCES_BY_INTERVAL','KFS14','1','CONFG','M=12;Q=4','Maximum number of recurrences allowed by interval','A','KFS'),('KFS-AR','OrganizationOptions','INSTITUTION_NAME','KFS15','1','CONFG','Indiana University','Indiana University','A','KFS'),('KFS-AR','OrganizationOptions','REMIT_TO_ADDRESS_EDITABLE_IND','KFS16','1','CONFG','N','This parameter controls whether the Remit to Address on the Accounts Receivable Organization Options is editable. When set to \"Y\" the Remit to Address is editable, when \"N\" the Remit to Address is not editable.','A','KFS'),('KFS-AR','OrganizationOptions','REMIT_TO_NAME_EDITABLE_IND','KFS17','1','CONFG','N','This parameter controls whether the Remit to Name on the Accounts Receivable Organization Options is editable. When set to \"Y\" the Remit to Name is editable, when \"N\" the Remit to Name is not editable.','A','KFS'),('KFS-BC','BudgetConstruction','ANNUAL_WORKING_HOURS','KFS18','1','CONFG','2080','The total working hours in a year','A','KFS'),('KFS-BC','BudgetConstruction','BIWEEKLY_PAY_TYPE_CODES','KFS19','1','CONFG','B','The Labor Object table pay type code for hourly/biweekly pay.','A','KFS'),('KFS-BC','BudgetConstruction','BUDGET_AGGREGATION_CODES','KFS20','1','VALID','O','Allowed Object Budget Aggregation Code(s)','A','KFS'),('KFS-BC','BudgetConstruction','EXPENDITURE_OBJECT_TYPES','KFS21','1','VALID','EE;EX;ES;TE','Allowed Expenditure Object Type(s)','A','KFS'),('KFS-BC','BudgetConstruction','FR