INSERT INTO `krim_role_t` VALUES ('1','5ADF18B6D4847954E0404F8189D85002','1','User','KUALI','This role derives its members from the users in the Principal table. This role gives users high-level permissions to interact with RICE documents and to login to KUALI.','2','Y','2008-11-04 14:37:10'),('10000','DE4E2108-C924-B6F5-6943-D027CDD1A6FF','2','TK_APPROVER','KUALI','','30','Y',NULL),('10001','EE05AC4E-3B56-388C-AA9A-D36BB43E6803','1','TK_EMPLOYEE','KUALI','','1','Y',NULL),('10002','0E4135A5-6C8A-F136-43EB-AD8812CD6DE2','1','TK_SYS_ADMIN','KUALI','','1','Y',NULL),('2','KFS2','1','Biller','KFS-AR','Users identified as part of an AR billing organization. ','38','Y',NULL),('25','2944063a202b493796ef750d44e55e9e','1','TK_ORG_ADMIN','KUALI','This role is used for mapping out the TK Org Admins','2','Y','2010-01-01 00:00:00'),('28','KFS28','1','Accounting Reviewer','KFS-SYS','An optional role that allows users to receive workflow action requests for documents of a specified type that contain accounts belonging to a specified chart and organization (including the organization hierarchy) and within a certain dollar amount or involving a specified override code.','30','Y',NULL),('30','KFS30','1','Accounts Receivable Lockbox Manager','KFS-SYS','Central Accounts Receivable staff that receive workflow action requests for Cash Control and Lockbox documents. They can also use the Electronic Fund Transfer screen and claim those funds using a Cash Control document.','27','Y',NULL),('32','KFS32','1','Active Faculty or Staff','KFS-SYS','A role that uses the Affiliation Type and Employee Status on a Principal record to determine if a user is an active faculty or staff employee. These users can initiate some KFS-PURAP documents and inquire into certain KFS screens.','41','Y',NULL),('36','KFS36','1','University Administration Budget Manager','KFS-SYS','An optional role created to receive action requests for Budget Adjustment documents at the Organization Route Node. Intended to receive requests for the top level chart and organization (thus receiving all Budget Adjustment documents).','1','Y',NULL),('37','KFS37','1','Chart Manager','KFS-SYS','Defines users responsible for managing the chart data for a given Chart of Accounts code. They may initiate Global Object Code and Organization Reversion maintenance documents and modify the Campus and Organization Plant Chart Code and Account on Organization documents.','25','Y',NULL),('40','KFS40','1','Contracts & Grants Project Director','KFS-SYS','This role defines the list of users that may be selected as Project Directors on the Proposal or Award document.','1','Y',NULL),('42','KFS42','1','Fiscal Officer Primary Delegate','KFS-SYS','This role derives its members from the Primary delegates defined in the Account Delegate table in KFS.','39','Y',NULL),('44','KFS44','1','Manager','KFS-SYS','This role represents a collection of all the KFS module manager roles and has permission to initiate simple maintenance documents and restricted documents such as the JV and LLJV. These users also have the ability to blanket approve most document types and assign roles and permissions for all KFS namespaces.','1','Y',NULL),('46','KFS46','1','Plant Fund Accountant','KFS-SYS','This role manages the plant fund functions associated with KFS-CAM and has special permissions related to assets in support of these functions. It can also edit the Organization and Campus Plant Chart and Account fields on the Organization document.','1','Y',NULL),('49','KFS49','1','Tax Identification Number User','KFS-SYS','Users with a need to view unmasked Tax ID numbers. They can also modify the tax number associated with AR customer records and PURAP vendor records.','1','Y',NULL),('51','KFS51','1','Technical Administrator','KFS-SYS','A technical administrator that is specific to the KFS system. This role has no inherent permissions or responsibilities.','1','Y',NULL),('55','KFS55','1','Workflow Administrator','KFS-SYS','Users capable of taking superuser action on KFS documents and blanket approving some document types not available to the KFS-SYS Manager role.','1','Y',NULL),('59','5BABFACC4F62A8EEE0404F8189D8770F','1','Approve Request Recipient','KR-WKFLW','This role derives its members from users with that have received an action request for a given document.','42','Y','2008-11-14 14:10:17'),('60','5BABFACC4F63A8EEE0404F8189D8770F','1','Initiator','KR-WKFLW','This role derives its members from the initiator listed within the route log of a given document.','43','Y','2008-11-14 14:10:17'),('61','5BABFACC4F64A8EEE0404F8189D8770F','1','Initiator or Reviewer','KR-WKFLW','This role derives its members from the initiator and action request recipients listed within the route log of a given document.','43','Y','2008-11-14 14:10:17'),('63','5B31640F0105ADF1E0404F8189D84647','1','Technical Administrator','KR-SYS','This role can take superuser actions and blanket approve RICE documents as well as being able to modify and assign permissions, responsibilities and roles belonging to the KR namespaces.','1','Y','2008-11-08 11:55:22'),('65','KFS65','1','Regional Budget Manager','KFS-SYS','An optional role created to receive action requests for Budget Adjustment documents at the Organization route Node. Intended to receive only requests associated with regional campus charts and organizations.','1','Y',NULL),('66','5BABFACC4F61A8EEE0404F8189D8770F','1','Document Editor','KR-NS','This role derives its members from users with the Edit Document permission for a given document type.,','45','Y','2008-11-14 14:10:17'),('67','5BABFACC4F65A8EEE0404F8189D8770F','1','Router','KR-WKFLW','This role derives its members from the user who took the Complete action on a given document.','43','Y','2008-11-14 14:10:17'),('68','KFS68','1','Sub-Account Reviewer','KFS-PURAP','Users who wish to receive workflow action requests for KFS-PURAP documents that involve a specific account number and sub-account number.','47','Y',NULL),('83','606763510FBF96D3E0404F8189D857A2','1','Document Opener','KR-NS','This role derives its members from users with the Open Document permission for a given document type.,','60','Y','2009-01-13 19:26:16'),('85','KFS85','1','Sensitive Related Document Initiator Or Reviewer','KFS-PURAP','A role that derives the users who initiated or received a workflow action request for a sensitive KFS-PURAP document.','48','Y',NULL),('88','6102F3FA08CE45CFE0404F8189D8317E','1','Acknowledge Request Recipient','KR-WKFLW','This role derives its members from users with an acknowledge action request in the route log of a given document.','42','Y','2009-01-21 13:02:02'),('89','6102F3FA08CF45CFE0404F8189D8317E','1','FYI Request Recipient','KR-WKFLW','This role derives its members from users with an FYI action request in the route log of a given document.','42','Y','2009-01-21 13:02:03'),('90','61815E6C62D0B647E0404F8189D873B3','1','System User','KR-SYS','This role represents the KR System User, that is the user ID RICE uses when it takes programmed actions.','1','Y','2009-08-21 03:52:58'),('95','67F145466E8B9160E0404F8189D86771','1','Document Initiator','KR-SYS','This role derives its members from users with the Initiate Document permission for a given document type.','66','Y','2009-08-21 03:52:58'),('97','67F145466EB09160E0404F8189D86771','1','Non-Ad Hoc Approve Request Recipient','KR-WKFLW','This role derives its members from users with an Approval action request (that was not generated via the ad-hoc recipients tab) in the route log of a given document.','42','Y','2009-08-21 03:52:58'),('KFSENDOW1','KFSENDOW1','1','KEMApprovers','KFS-ENDOW','Review and approve endowment documents','1','Y',NULL);
